import React from 'react';

const NickNameEditForm = () => {
    return (
        <Form style={{ marginBottom: '20px', border: '1px solid #d9d9d9', padding: '20px' }}>
            <Input.Search addonBefore="닉네임" enterButton="수정" />
        </Form>
    );
};

export default NickNameEditForm;
